import React from "react";
import { Pane, Text, Button, Heading } from "evergreen-ui";

function MyBookingsPage() {
  return (
    <div>
      <Pane height={1000} backgroundColor="beige" display="flex" justifyContent="center" padding={20}>
        <Heading size={800}>My Bookings Page</Heading>
      </Pane>
      <Table>
        <Table.Head>
          <Table.SearchHeaderCell />
          <Table.TextHeaderCell>
            Last Activity
    </Table.TextHeaderCell>
          <Table.TextHeaderCell>
            ltv
    </Table.TextHeaderCell>
        </Table.Head>
        <Table.Body height={240}>
          {profiles.map(profile => (
            <Table.Row key={profile.id} isSelectable onSelect={() => alert(profile.name)}>
              <Table.TextCell>{profile.name}</Table.TextCell>
              <Table.TextCell>{profile.lastActivity}</Table.TextCell>
              <Table.TextCell isNumber>
                {profile.ltv}
              </Table.TextCell>
            </Table.Row>
          ))}
        </Table.Body>
      </Table>
    </div>
  );
}

export default MyBookingsPage;
